def maxDiff(arr, arr_size):
    max_diff = arr[1] - arr[0]
     
    for i in range( arr_size ):
        for j in range( i+1, arr_size ):
            if(arr[j] - arr[i] > max_diff):
                max_diff = arr[j] - arr[i]
                if(max_diff < 0):
                	max_diff = max_diff*-1
     
    return max_diff

